import "./Home.css";

import logo from "../../assets/Logo.svg";
import { Image, Row, Col, Container } from "react-bootstrap";

import React from "react";

function Home() {
	return (
		<Container fluid>
			<Row xl={1}>
				<Col className="text-center">
					<Image fluid src={logo} className="w-20 mt-5 mb-5"></Image>
				</Col>
				<Col className="back-site text-center m-0">
					<h2 className="title mt-3">
						Nuestra Web está en <br></br> proceso...
					</h2>
					<p>
						Pero quédate cerca, el lanzamiento será pronto. Deja tus
						datos y te avisamos!
					</p>
				</Col>
			</Row>
		</Container>
	);
}

export default Home;
